window.bookSummaryJSON = "<p>The Federation races to discover the culprits of several terrorist attacks, sending their flagship, the USS <i>Prometheus</i>, to stop war breaking out in the galaxy. </p> <p>The situation in the Lembatta Cluster is deteriorating rapidly. Fleets from the Federation and Klingon Empire are heading for the borders. The crews of the USS <i>Prometheus </i>and IKS <i>Bortas </i>are racing against time to break the cycle of violence that is spreading through the Alpha Quadrant. </p> <p>Adams and Kromm are on the trail of a secret weapons facility but instead discover an enemy from their pasts who seems utterly unstoppable. Together, they search for the answers to their questions before the galaxy goes down in flames.</p>"; 
